const Test =()=>{
    return(
        <div className="nav">
            <ul>
                <li><a href="#">خانه</a></li>
                <li><a href="#">جنگل</a></li>
                <li><a href="#">بیابان</a></li>
                <li><a href="#">زیبا</a></li>
                <li><a href="#">زشت</a></li>
            </ul>
        </div>
    )
}

export default Test
